import {BrowserRouter as  Router,Routes,Route, BrowserRouter} from 'react-router-dom'
import './App.css';

// Switch is updated to Routes in 
function App() {
  return (
    <Router>
       <Navbar></Navbar>
       {/* <Banner></Banner> */}

       <Switch>
       <Route path='/faviourates' component={Faviourates} />
       <Route path='/' component={Movies} />
       </Switch>

       {/* <Banner></Banner>
       <Movies></Movies>
       <Faviourates></Faviourates> */}

    </Router>
  );
}

export default App;
